CREATE OR ALTER VIEW biz.vw_DomainAutorization_Flattened
AS
	SELECT Entra_GroupName, PermissionLevel, PermissionGroup
	FROM (
			SELECT * 
			FROM biz.DomainAutorization
		 ) arr
	UNPIVOT
		(
			PermissionLevel FOR PermissionGroup IN (Permission_Client_Detail, Permission_Client_Aggregated, Permission_Employee_Detail, Permission_Employee_Aggregated, Permission_Finance_Detail, Permission_Finance_Aggregated)
		) unpiv

