--------------------------DM schema--------------------------
CREATE OR ALTER FUNCTION dm.udf_Permission_EntireOrganization
(
	@PermissionGroup varchar(50)
)
RETURNS TABLE 
AS
RETURN
(	--select distinct for people in multioke grouos
	SELECT DISTINCT gas.UserPrincipalName
				  , cc.Costcenter
	FROM biz.GroupAssignment gas
		JOIN biz.vw_DomainAutorization_Flattened daf ON gas.Entra_GroupName = daf.Entra_GroupName
		, (
			SELECT Costcenter
			FROM biz.CostcenterHierarchy
		  ) cc
	WHERE daf.PermissionGroup = @PermissionGroup
	  AND daf.PermissionLevel = 'Entire organization'
)
GO
--select * from biz.udf_Permission_EntireOrganization ('Permission_Client_Detail')

CREATE OR ALTER FUNCTION dm.udf_Permission_OrganizationalHierachy
(
	@PermissionGroup varchar(50)
)
RETURNS TABLE 
AS
RETURN
(	--select distinct for people in multioke grouos
	SELECT DISTINCT gas.UserPrincipalName
				  , cca.Costcenter
	FROM biz.GroupAssignment gas
		JOIN biz.vw_DomainAutorization_Flattened daf ON gas.Entra_GroupName = daf.Entra_GroupName
		JOIN biz.CostcenterAutorization cca ON gas.UserPrincipalName = cca.UserPrincipalName
	WHERE daf.PermissionGroup = @PermissionGroup
	  AND daf.PermissionLevel = 'Organizational Hierachy'
)
--select * from biz.udf_Permission_OrganizationalHierachy ('Permission_Client_Detail')
