DROP FUNCTION IF EXISTS dbo.Numbers;
GO
CREATE   FUNCTION dbo.Numbers (@n AS BIGINT) 
RETURNS TABLE
AS
RETURN
WITH e1(n) AS
(
    SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1 UNION ALL SELECT 1
)
, 
e2(n) AS 
(
	SELECT 1 FROM	e1 
	CROSS JOIN		e1 b
	CROSS JOIN		e1 c
	CROSS JOIN		e1 d
	CROSS JOIN		e1 e
)
,Numbers AS
(
	SELECT n	= ROW_NUMBER() OVER (ORDER BY n) 
	FROM	e2
)
SELECT n 
FROM	Numbers 
WHERE n <= @n;
GO

IF EXISTS (
		SELECT *
		FROM sys.objects
		WHERE object_id = OBJECT_ID(N'dm.Dim_Date')
			AND type IN (N'U')
		)
BEGIN
	DROP TABLE dm.Dim_Date
END

DECLARE @start_date varchar(8) = '20221231';
DECLARE @number_of_years int = 5;
WITH GeneratedDate as
(
	SELECT DATEADD(d,a.n,@start_date) AS Date
	FROM dbo.Numbers(5000) a 
	WHERE DATEADD(d,a.n, @start_date) <=  DATEFROMPARTS(YEAR(SYSDATETIME())+@number_of_years,12,31)
)
SELECT cast(convert(char(8), a.Date, 112) as bigint) AS PK_Date
	 , a.Date
	 , DATENAME(day, a.Date) + ' ' + format(a.Date,'MMMM', 'EN') + ' ' + DATENAME(year, a.Date) AS DateDesc
	 , YEAR(a.Date) AS Year
	 , RIGHT('00' + CAST(MONTH(a.Date) as nvarchar),2) AS MonthNumber
	 , FORMAT(a.Date,'MMMM','EN') AS MonthName  
	 , FORMAT(a.Date,'MMM','EN') AS MonthNameShort
	 , 'Q' + CAST(DATEPART(QUARTER,a.Date)as nvarchar) AS Quarter
	 , right('00'+CAST(DATEPART(ISOWK, a.Date) as nvarchar),2) AS Week
	 , IIF(DATEPART(dw, a.Date)-1 = 0,7,DATEPART(dw, a.Date)-1) AS WeekDayNumber
	 , DATEPART(DAY,a.Date) AS MonthDayNumber
	 , FORMAT(a.Date, 'dddd' ,'EN') AS DayName
	 , YEAR(a.Date)*100+month(a.Date) AS YearMonth
	 , CAST(IIF(
			DATEPART(ISOWK, a.Date) >50 and MONTH(a.Date) = 1
			,YEAR(a.Date)-1
			,IIF(DATEPART(ISOWK, a.Date)  = 1 and month(a.Date) = 12, year(a.Date)+1
			,YEAR(a.Date)))
			as nvarchar) AS WeekYear
	, iif(
			DATEPART(ISOWK, a.Date) >50 and MONTH(a.Date) = 1
			,YEAR(a.Date)-1
			,IIF(DATEPART(ISOWK, a.Date)  = 1 and MONTH(a.Date) = 12, YEAR(a.Date)+1
			,YEAR(a.Date)))*100
			+DATEPART(ISOWK, a.Date)
			AS YearWeek
	, DATEDIFF(week, SYSDATETIME(), a.Date) AS YearWeekFromToday
	, IIF(a.Date = CAST(GETDATE() AS DATE), 0
		, IIF(a.Date < CAST(GETDATE() AS DATE)
		, ROW_NUMBER() OVER (PARTITION BY IIF(a.Date < CAST(GETDATE() AS DATE),0,1) ORDER BY a.Date DESC)*-1
		, ROW_NUMBER() OVER (PARTITION BY IIF(a.Date <= CAST(GETDATE() AS DATE),0,1) ORDER BY a.Date ASC)
		)) AS DayNumberFromToday
INTO dm.Dim_Date
FROM GeneratedDate a
GO
CREATE OR ALTER VIEW dm.vw_Dim_Date
AS
	SELECT PK_Date
		 , Date
		 , DateDesc
		 , Year
		 , MonthNumber
		 , MonthName
		 , MonthNameShort
		 , Quarter
		 , Week
		 , WeekDayNumber
		 , MonthDayNumber
		 , DayName
		 , YearMonth
		 , WeekYear
		 , YearWeek
		 , YearWeekFromToday
		 , DayNumberFromToday
	FROM dm.Dim_Date

